.0 END <= 100.0) THEN CASE WHEN (-100.0 <= -linear_model_cte."Score_3") THEN -linear_model_cte."Score_3" ELSE -100.0 END ELSE 100.0 END))) AS "Proba_2", (1.0 / (1.0 + exp(CASE WHEN (CASE WHEN (-100.0 <= -linear_model_cte."Score_3") THEN -linear_model_cte."Score_3" ELSE -100.0 END <= 100.0) THEN CASE WHEN (-100.0 <= -linear_model_cte."Score_3") THEN -linear_model_cte."Score_3" ELSE -100.0 END ELSE 100.0 END))) / (1.0 / (1.0 + exp(CASE WHEN (CASE WHEN (-100.0 <= -linear_model_cte."Score_0") THEN -linear_model_cte."Score_0" ELSE -100.0 END <= 100.0) THEN CASE WHEN (-100.0 <= -linear_model_cte."Score_0") THEN -linear_model_cte."Score_0" ELSE -100.0 END ELSE 100.0 END)) + 1.0 / (1.0 + exp(CASE WHEN (CASE WHEN (-100.0 <= -linear_model_cte."Score_1") THEN -linear_model_cte."Score_1" ELSE -100.0 END <= 100.0) THEN CASE WHEN (-100.0 <= -linear_model_cte."Score_1") THEN -linear_model_cte."Score_1" ELSE -100.0 END ELSE 100.0 END)) + 1.0 / (1.0 + exp(CASE WHEN (CASE WHEN (-100.0 <= -linear_model_cte."Score_2") THEN -linear_model_cte."Score_2" ELSE -100.0 END <= 100.0) THEN CASE WHEN (-100.0 <= -linear_model_cte."Score_2") THEN -linear_model_cte."Score_2" ELSE -100.0 END ELSE 100.0 END)) + 1.0 / (1.0 + exp(CASE WHEN (CASE WHEN (-100.0 <= -linear_model_cte."Score_3") THEN -linear_model_cte."Score_3" ELSE -100.0 END <= 100.0) THEN CASE WHEN (-100.0 <= -linear_model_cte."Score_3") THEN -linear_model_cte."Score_3" ELSE -100.0 END ELSE 100.0 END))) AS "Proba_3", CAST(NULL AS FLOAT) AS "LogProba_0", CAST(NULL AS FLOAT) AS "LogProba_1", CAST(NULL AS FLOAT) AS "LogProba_2", CAST(NULL AS FLOAT) AS "LogProba_3", CAST(NULL AS BIGINT) AS "Decision", CAST(NULL AS FLOAT) AS "DecisionProba" 
